import React from "react";

export default function Plants(props) {
  console.log(props);

  const plantList = props.plants.map((plant) => {
    return (<tr>
      <td><img src="https://extension.umass.edu/plant-identification/sites/plant-identification/files/styles/50x50/public/plant/images/Ageratum%201%20Plant.jpg?itok=hLwxwbOg" alt="Girl in a jacket" width="50" height="50" /></td>
      <td>{plant.name}</td>
    </tr>
    )
  });

  return (
    <table>
      <thead>
        <tr>
          <th rowSpan="2">Plant</th>
        </tr>
      </thead>
      <tbody>{plantList}</tbody>
    </table>
  );
}
